import { GlobalStyle, WeatherCard, Code, BreakLine, Subtitle } from '../../styles/styles';
const SocialMedia = () => {
	return (
		<GlobalStyle>
			<WeatherCard>
				<div>'Texting a simple text'</div>
			</WeatherCard>
		</GlobalStyle>
	);
};

export default SocialMedia;
